import React from 'react';
import axios from 'axios';

axios.get('http://localhost:8080/device_summary', {
            headers: {
                'Access-Control-Allow-Origin': '*',
            },
            proxy: {
                host: '192.168.0.132',
                port: 3000
            }
        }

    )
    .then(res => {
        console.log(res.headers);
    })
    .catch(error => {
        console.log(error);
    })
export default class App extends React.Component {

    render() {
        return ("he");
    }
}
